(1020, 21, 'R2-CS- WP-25', 'VERTICAL SURFACES :a) Treatment shall consist of preparation of surfaces including ‘V’ grooves at junctions and joints, pressure grouting the same and curing for specified period.b) Applying two coats of approved crystalline waterproofing compound at specified intervals as recommended by manufacturer and as directed by Engineer-in charge and allowed to cure.c) Extra for Plastering of walls and finishing smooth with 15 mm thick cement mortar 1:4 (1 cement : 4 fine sand) admixed with approved waterproofing compound in recommended proportions. HORIZONTAL SURFACES :d) Extra for Laying of 30 mm average thick cement concrete of mix 1:2:4 (1 cement : 2 coarse sand : 4 coarse aggregate of 12.5mm nominal size) admixed with approved waterproofing compound in recommended proportions, on floors to required gradient, including rounding of corners/ junctions with walls and floors etc., and finished smooth and cured. Tank shall be tested by filling with water for required depth and maintaining it for 72 hrs. for checking the leakages. The rate includes giving 10 year guarantee for waterproofing on a Rs.100/- stamp paper in approvedproforma.', 930, 2537, 'Sqm', 23, 25, NULL, 0, NULL, 1, 25, '2022-05-30 12:46:41'),
(1021, 21, 'R2-CS- WP-33', 'Providing waterproofing treatment from outside to basement lift-pits and other under ground structures during construction. The treatment shall be started after the P.C.C. bedding for the base slab or raft slab is laid. On theP.C.C. bedding a waterproofing layer based on cement with rough shahabad stones of 20 to 25 mm thick well pointed in the joints with 1:3 C.S. 40 mm thick for floors and 20 mm thick for sides with cement float and water proofing compound as per specifications shall be laid. Then the surface shall be superimposed by regular R.C.C. raft or base slab as per design. After completion of the raft / base slab and side walls the treatment of waterproofing layer shall be continued along the outer surface of the walls upto a height of 30 cm above the adjacent ground level. (The excavation of the side around the walls shall be filled with soft earth by the contractor ). The total thickness of the treatment shall be 65 mm to 75 mm forfloors and 32 mm to 38 mm for walls.', 1145, 1336, 'Sqm', 15, 25, NULL, 0, NULL, 1, 25, '2022-05-30 12:46:41'),
