(1039, 21, 'R2-CS- AW-05', 'Providing and fixing in position Top/side hung window of extruded modular and anodised aluminum sections of approved make and of size38.10 mm x 25.40 mm x 1.44 mm thk (wt. 0.471 kg/Rm) for outer rectangular tube, 40 mm x 31.5 mm x 1.5 mm (wt.0.549 kg/Rm) for outer frame, 40 mm x31.50 mm x 1.50 mm thk (wt. 0.502 kg/Rm) for central mullion, 40 mm x31.50 mm x 1.50 mm thk (wt. 0.549 kg/Rm) for shutter and 16.50 mm x14.50 mm x 1.20 mm thk (wt. 0.157 kg/Rm) for glazing clip with 5 mm thick plain / frosted / tinted glass fixed in shutter including neoprene gasket,fixtures, fastenings and accessories like hinges, locking arrangement etc. complete as directed by Engineer In Charge.(Note: anodic film must not be less than 15 microns i.e. AC-15 as per IS, the anodizing must be scaleted by keeping the anodized section in boiling de- anodized water for a period of one hour)', 70, 7645, 'Sqm', 5, 25, NULL, 0, NULL, 1, 25, '2022-05-30 12:46:41');
