(3797, 65, 'Providing and applying Royale Luxury Emulsion of approved make on internal wall ', 'Providing and applying Royale Luxury Emulsion of approved make on internal wall surface as detailed below Scrapping for surface with emery paper and wipe clean for area. wall primer with brush by adding mineral turpentine oil by 8 to 10% or water by 15 to 20% allowing to dry for 6 to 8 hours After applying acrylic wall putty with appropriate prpportion of water of allow to dry for period of 4 to 6 hours of activity. Scrapping with emery paper and wipe clean Applying paints Royale Luxury emulsion 1st coat with brush water content water 40 to 45% or 65 to 70% by role Applying paints Royale luxury emulsion 2nd coat with brush with water content 40 to 45% or 65 to 70% by roller. (With prior approval of S.E.) ', 389, 250, 'Sq.M.', 97187.5, 86, '2023-12-29 12:26:34', NULL, NULL, 0, NULL, NULL),
(3798, 65, 'Providing and applying two coats Apex Ultima Puranature Anti-Pollution Or equivalent', 'Providing and applying two coats Apex Ultima Puranature Anti-Pollution Or equivalent approved brand, paint should decomposes organic substances and inorganic gases (NOx, VOCâ€™s, CO, SOx, formaldehydes, etc.) in presence of natural or artificial light. It contains Graphene and nanoparticles of titanium oxide. and Absorbs CO2 (4.8 Kilogram / 15l). plaster crack should be filled by Acrylic base Crack seal / Textured Crack filler, Paint has to applied on one coat of Apex Ultima Puranature Anti-Pollution Primer or Equivalent. Warranty Should be given by the Manufaturer The work should be done by the Manufacturer Recommended applicator and he should be able to furnish stage wise on site technical reports from the concerned company technologist.', 510, 340, 'Sq.M.', 173400, 86, '2023-12-29 12:27:50', NULL, NULL, 0, NULL, NULL),
(3799, 65, 'Providing waterproofing in W.C. and bath including brick bat coba', 'Providing waterproofing in W.C. and bath including brick bat coba in all position including providing and laying 12mm bedding in cement mortor 1:3 on vergin concrete slab with waterproofing compound @ 1kg/per bag of cement laying brick bat coba of  required thickness in cm 1:5 with waterproofing compound 1 kg/bag of cement grouting and finishing the top layer with 20mm thick brick bedding in cm mortor 1:3 with waterproofing compound 1 kg/per bag of cement and testing the treated portion for 48 hours by pond test and covering ten years\\'' guarantee on requisite stamp paper including curing etc. complete.', 10, 6000, 'Cu.M', 57312, 86, '2023-12-29 12:28:31', NULL, NULL, 0, NULL, NULL),
(3800, 65, 'Providing waterproof plaster in W.C. and bath 20 mm thick for dado', 'Providing waterproof plaster in W.C. and bath 20 mm thick for dado in cement mortar 1:3 with neat finishing, floating using waterproofing compound at the rate of 1 kg. per bag of cement of approved make and manufacturer and curing  (and filling joints of Nahani trap and any outlet by properly) etc. complete.', 57, 500, 'Sq.M.', 28292, 86, '2023-12-29 12:29:14', NULL, NULL, 0, NULL, NULL),
(3801, 65, 'Providing cement based waterproofing treatment to terraces', 'Providing cement based waterproofing treatment to terraces (Indian water proofing or alike) with brick bats laid in required slope to drain the water for any span after cleaning the base surface. Applying a coat of cement slurry admixed with approved waterproofing compound and laying the brick bats on bottom layer in C.M. 1:5 admixed with approved waterproofing compound filling upto half depth of brick bats, curing this layer for 3days, applying cement slurry over this layer joints of brick bats with C.M. 1:3 admixed with approved waterproofing compound and finally top finishing with average 20mm. thick layers of same mortar added with jute fiber at 1 Kilogram per bag including finishing the surface smooth with cement slurry admixed with approved waterproofing compound. Marking finished surface with false squares of 300 mm x 300 mm. making the junctions at the parapet rounded and tapered top for required height, with drip mould at the junction of plaster and parapet and curing and covering 10 years Guarantee against leakproofness on Court fee stamp paper of Rs.500/- including ponding test etc. complete.', 81, 1150, 'Sq.M.', 93644.5, 86, '2023-12-29 12:30:35', NULL, NULL, 0, NULL, NULL),
(3802, 65, 'Providing and laying jointless Polydee-LM, a highly flexible elastometric coating for RCC ', 'Providing and laying jointless Polydee-LM, a highly flexible elastometric coating for RCC / cementitious surface for terrace waterproofing on B.B. Coba / R.C.C, after application of TP-42 Primer on perfectly clean surface (free from loose dust and foreign matter) application of 1st coat of Polydee-LM @ 700 gms / One Square Metre and applying 2nd coat of Polydee- LM @ 700 gms / One Square Metre and finishing the same with sprinkling the AG- 10 granules on the wet coating. (After finishing covering the treatment with 25 mm cement plaster for protection with fibrillated 6mm Plyplast fibre @ 125 gms / One Square Metre to be paid in separate item.) covering 7 years guarantee on Court Fee Stamp Paper of Rs. 100/- etc. complete.', 81, 1050, 'Sq.M.', 85501.5, 86, '2023-12-29 12:31:26', NULL, NULL, 0, NULL, NULL),
