(3872, 65, 'Designing, Providing & Installation of Wall mural related to freedom fighter, ', 'Designing, Providing & Installation of Wall mural related to freedom fighter, outside the jail wall as shown in the picture below . The material for this sculpture is Fibre/FRP . The Length of the mural should be minimum 15m with minimum height of 3 m,  Size of the mural shall be in proportionate to the height of the sculpture. Thickness of FRP material should be 5- 10mm. Including all cost of design, Making models (if any), making mural, inspection charges, Transportation, Fixing at site, Construction of Foundation in RCC- M20 Grade Concrete including Reinforcement(TMT/FE 500), Pedestal including all material required for fixing the mural, coating the pedestal with Coaltar Epoxy Coating, all Filling material upto the base of mural, polishing and painting of the mural, as directed by Engineer in Charge. (Variation in size off mural shall be +-10% in Length, Width and Height shall be permitted.) Inclusive all taxes Exclulding of GST .etc. Complete.', 3, 1650000, 'Nos', 4950000, 86, '2023-12-30 12:18:01', NULL, NULL, 0, NULL, NULL),
