(3894, 65, 'GARDEN SOIL :- Supplying on site garden soil well sieved 90% to pass', 'GARDEN SOIL :- Supplying on site garden soil well sieved 90% to pass through I.S. sieve of 10mm size Free from stones rubbish like dried grass roots and other such materials.The soil should be fresh be measured by measuring box (Farma) Item includes royalty charges, octroi, corporation Tax    Transporting, loading â€“ unloading etc', 516, 1000, 'Cu.M', 516000, 86, '2023-12-30 13:48:40', NULL, NULL, 0, NULL, NULL),
(3895, 65, 'Farm yard manure :- Supplying on site well decayed, well dried,', 'Farm yard manure :- Supplying on site well decayed, well dried, well powedered, withought clods and free from stones, dried grass and other rubbish material,. The colour of the manure generally be black. the manure will be measuring by measure box. (farma) item includes Transporting, loading -unloading etc (lead charges per 40km. are considered.', 516, 1000, 'Cu.M', 516000, 86, '2023-12-30 13:49:01', NULL, NULL, 0, NULL, NULL),
(3896, 65, 'Preparing Instant Lawn :', 'Preparing Instant Lawn : Excavating the ground to a required depth of 30cms removing & conveying unwanted stuff to a required distance as directed. filling fresh garden soil / silt & manure in excavated area in 3:1 proportion to a height of 30cms. Mixing garden soil and manure thoroughly will levelling, watering on previous night. Planting required variety of lawn grass as directed and maintaining till well established by watering weeding clopping rolling etc. complete', 1720, 900, 'Sq.M.', 1548000, 86, '2023-12-30 13:49:22', NULL, NULL, 0, NULL, NULL),
(3897, 65, 'Preparing Shrubbery ', 'Preparing Shrubbery :- Excavating the round to required depth of 30cms, removing and conveying unwanted stuff to a required excavated area in 3:1 proportion to a height of 30cms. Mixing garden soil & manure toughly well, leveling , watering on previous As derected by Engineer-Incharge.', 14, 900, 'Sq.M.', 12150, 86, '2023-12-30 13:49:44', NULL, NULL, 0, NULL, NULL),
(3898, 65, 'Planting large flowering / shady trees ', 'Planting large flowering / shady trees :- Digging pit with size 0.9m x 0.9m x 0.9m removing and conveying unwanted stuff to a required distance as directed. Filling the pit with approved excavated material upto a height of 0.30m and remaining height of 0.60m with fresh garden soil & manure in 3:1 proportion Mixing soil & manure thoroughly well. leveling as directed, watering previous night, planting on to two year old healthy trees sapling as per specifications. Maintaining till well established by watering weeding, stirring of soil replacing of casualties etc. complete.', 20, 850, 'Nos', 17000, 86, '2023-12-30 13:50:06', NULL, NULL, 0, NULL, NULL);
