(4017, 68, 'Providing and applying first single coat of approved primer and two coats of synthetic enamel paint/flat oil paint of an approved make and colour as per manufacturers ', 'as per manufacturers pecifications to surfacesspecifird below, at all height and locations as directed including scaffolding, cleaning and preparing surfaces for painting by any approved means etc. complete as directed by Engineer-in- charge. For plastered wall surface', 6423, 187, 'Sq.M.', 1201144.01, 86, '2024-04-11 16:50:31', NULL, NULL, 0, NULL, NULL),
