(4019, 68, 'Providing and laying integral cement based water proofing treatment including preparation of surface as required for treatment of roofs, balconies, terraces etc', 'consisting of following operations: a) Applying a slurry coat of neat cement using 2.75 kg/sqm of cement admixed with water proofing compound conforming to IS. 2645 and approved by Engineer-in-charge over the RCC slab including adjoining walls upto 300 mm height including cleaning the surface before treatment. b) Laying brick bats with mortar using broken bricks/brick bats 25 mm to 115 mm size with 50% of cement mortar 1:5 (1 cement : 5 coarse sand) admixed with water proofing compound conforming to IS : 2645 and approved by Engineer-in-charge over 20 mm thick layer of cement mortar of mix 1:5 (1 cement :5 coarse sand ) admixed with water proofing compound conforming to IS : 2645 and approved by Engineer-in- charge to required slope and treating similarly the adjoining walls upto 300 mm height including rounding of junctions of walls and slabs c) After two days of proper curing applying a second coat of cement slurry using 2.75 kg/ sqm of cement admixed with water proofing compound conforming to IS : 2645 and approved by Engineer-in-charge. d) Finishing the surface with 20 mm thick jointless cement mortar of mix 1:4 (1 cement :4 coarse sand) admixed with water proofing compound conforming to IS : 2645 and approved by Engineer-in-charge including laying glass fibre cloth of approved quality in top layer of plaster and finally finishing the surface with trowel with neat cement slurry and making pattern of 300x300 mm square 3 mm deep. e) The whole terrace so finished shall be flooded with water for a minimum period of two weeks for curing and for final test. All above operations to be done in order and as directed and specified by the Engineer-in-Charge : With average thickness of 120 mm and minimum,thickness at khurra', 381, 1704, 'Sq.M.', 649990.8, 86, '2024-04-11 16:52:35', NULL, NULL, 0, NULL, NULL),
